import React from 'react'
import {Column, Flex} from './layout'
import styled from 'styled-components'

const Box = styled(Column)`
  background-color: white;
  box-shadow: 0 0 5px 2px #A2AEB7;
  border: 1px solid #000000;
`

const Option = styled.p`
  font-size: 16px;
  color: ${props => props.theme.colors.darkBlue};
  font-weight: 700;
`

const CheckList = ({items}) => <Flex justifyContent="center">
    {items.map(item => (
        <Box alignItems="center" justifyContent="center" m={10} height={140} width={140}>
            <Option fontSize={16}>{item}</Option>
        </Box>
    ))}
</Flex>

export default CheckList
